import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
  Link,
} from "react-router-dom";

import "./Header.css";

const Header = ({ userData, setRedirect, setUser }) => {
  if (userData.username === "") {
    console.log("SETTING USER");
    setUser();
  }
  return (
    <>
      <div className="header">
        <div className="logo">
          <h1>A Musical Planet</h1>
        </div>
        <div className="navbar">
          <Link className="linkButton" to="/maps">
            Maps
          </Link>
          <Link className="linkButton" className="linkButton" to="/maps">
            About
          </Link>
          <Link className="linkButton" to="/maps">
            Leaderboard
          </Link>
          {userData.username ? (
            <Link className="linkButton" to="/maps">
              {userData.username}
            </Link>
          ) : (
            <></>
          )}
        </div>
      </div>
    </>
  );
};

export default Header;
